{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/amadolambert/story-about-fitbit-for-bellabeat-google-capstone?scriptVersionId=195745891\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"f0c34909","metadata":{"papermill":{"duration":0.015305,"end_time":"2024-09-07T22:36:40.476479","exception":false,"start_time":"2024-09-07T22:36:40.461174","status":"completed"},"tags":[]},"source":[]},{"cell_type":"markdown","id":"2a96b2ef","metadata":{"_cell_guid":"b1076dfc-b9ad-4769-8c92-a6c4dae69d19","_uuid":"8f2839f25d086af736a60e9eeb907d3b93b6e0e5","execution":{"iopub.execute_input":"2024-09-06T18:03:49.732978Z","iopub.status.busy":"2024-09-06T18:03:49.730588Z","iopub.status.idle":"2024-09-06T18:03:49.862255Z"},"papermill":{"duration":0.014208,"end_time":"2024-09-07T22:36:40.505845","exception":false,"start_time":"2024-09-07T22:36:40.491637","status":"completed"},"tags":[]},"source":["**COMPETITIVE INTELLIGENCE STORY ABOUT FITBIT FOR BELLABEAT INC. USING R-SCRIPT & TABLEAU**\n","\n","\n","\n","Project Link at Tableau Public (https://public.tableau.com/views/BellaBeatCompetitiveIntelCapstoneLook1/Story1?:language=en-US&:sid=&:redirect=auth&:display_count=n&:origin=viz_share_link)\n","![](https://storage.googleapis.com/kagglesdsdata/datasets/5661443/9341762/Story%202.png?X-Goog-Algorithm=GOOG4-RSA-SHA256&X-Goog-Credential=databundle-worker-v2%40kaggle-161607.iam.gserviceaccount.com%2F20240907%2Fauto%2Fstorage%2Fgoog4_request&X-Goog-Date=20240907T223335Z&X-Goog-Expires=345600&X-Goog-SignedHeaders=host&X-Goog-)\n","\n","**I.\tIntroduction**\n","•\tOverview of the Wearable Fitness Technology Industry\n","The wearable fitness technology industry has seen significant growth, driven by increasing health consciousness, fitness tracking adoption, and technological advancements. The market reached a value of $12.4 billion in 2023 and is expected to grow at a compound annual growth rate (CAGR) of 10.2% from 2023 to 2033 (Future Market Insights, 2023).\n","\n","**II.\tGender Overview:** \n","\n","As of 2023, 35% of women and 34% of men in the United States use wearable fitness or wellness devices. These devices, such as Fitbit, Garmin, and smartwatches, track vitals like blood pressure, heart rate, sleep patterns, and physical activity (Statista, 2023).\n","\n","**III.\tExperience Categories:** \n","\n","Wearable fitness technology caters to users across different experience levels:\n","•\tBeginners: Often use basic fitness trackers to monitor steps, distance, and sleep.\n","•\tIntermediate: Utilize devices with more advanced features like heart rate monitoring and GPS tracking.\n","•\tAdvanced: Prefer high-end devices that offer detailed performance metrics, personalized fitness recommendations, and integration with other health apps.\n","\n","**IV.\tLeading Brands:**\n","•\tFitbit: Known for its broad range of features including step counting, heart rate monitoring, and sleep analysis (Wirecandy).\n","•\tBellabeat: Focuses on creating smart devices specifically for women’s health, offering products like the Leaf wellness tracker and the Bellabeat app (Beepinhand)\n","•\tApple: Leads the wearable brand usage ranking in the U.S., with a usage rate of almost 40% (Statista).\n","•\tGarmin: Popular for its GPS tracking and performance metrics, especially among athletes (Wareable).\n","\n","\n","**V.\tThe Business Task**\n","Guiding Questions: \n","a)\tHow are customers using Bellabeat devices? \n","b)\tWhat trends exist in the wearable tech market? \n","c)\tHow could these trends apply to Bellabeat customers? \n","d)\tHow could these trends help influence Bellabeat marketing strategy?\n","e)\tWhat Bellabeat features are of the same class as Fitbit and use the same data measures?\n","\n","**Objective:**\n","To gain insights from the collected data that will help Bellabeat compete against leading brands in the wearable fitness tracking space.  Several downloaded CSV files make up the Fitbit tracking dataset containing three months of usage data for 35 users. \n","Hypothetical strategies derived from the data analysis:\n","1.\tImprove upon best-in-class standard devices and services.\n","2.\tUnderstand usage trends and patterns to shoot gaps wherever there are unmet needs within the fitness tracking community.\n","3.\tIdentify top Bellabeat innovations and solutions for stated deficiencies in the market then distinguish its proprietary goods and services from top competitors.\n","4.\tAssess the need to educate/market to existing customers the benefits of optimizing their user experience and activating unused features for greater outcomes.\n","5.\tExplore the feasibility of entry into the training group tracking platform space in direct competition with COROS Wearables Inc. promoting back-end platform for trainers and coaches in charge of women’s fitness training groups, dance companies and competitive sports programs.\n","The product at first thought as best poised to benefit from these analytics would be Bellabeat+ Club Membership subscription renewals and upgrades with particular emphasis on the Wellness Coach tracking elements.\n","\n","**VI.\tData Preparation**\n","Two dataset folders downloaded from Kaggle located at https://www.kaggle.com/datasets/arashnic/fitbit contain CSV spreadsheets collecting individual tracking information as follows:\n","\n","Table 1 Fitbit datasets"]},{"cell_type":"markdown","id":"0f26b6bb","metadata":{"_cell_guid":"b1076dfc-b9ad-4769-8c92-a6c4dae69d19","_uuid":"8f2839f25d086af736a60e9eeb907d3b93b6e0e5","execution":{"iopub.execute_input":"2024-09-06T18:03:49.732978Z","iopub.status.busy":"2024-09-06T18:03:49.730588Z","iopub.status.idle":"2024-09-06T18:03:49.862255Z"},"papermill":{"duration":0.014435,"end_time":"2024-09-07T22:36:40.534193","exception":false,"start_time":"2024-09-07T22:36:40.519758","status":"completed"},"tags":[]},"source":["![Table 1](https://storage.googleapis.com/kagglesdsdata/datasets/5657169/9335766/DataSet_Table_Screenshot%202024-08-27%20115824.png?X-Goog-Algorithm=GOOG4-RSA-SHA256&X-Goog-Credential=databundle-worker-v2%40kaggle-161607.iam.gserviceaccount.com%2F20240906%2Fauto%2Fstorage%2Fgoog4_request&X-Goog-Date=20240906T204753Z&X-Goog-Expires=345600&X-Goog-SignedHeaders=host&X-Goog-)"]},{"cell_type":"markdown","id":"505b1185","metadata":{"_cell_guid":"b1076dfc-b9ad-4769-8c92-a6c4dae69d19","_uuid":"8f2839f25d086af736a60e9eeb907d3b93b6e0e5","execution":{"iopub.execute_input":"2024-09-06T18:03:49.732978Z","iopub.status.busy":"2024-09-06T18:03:49.730588Z","iopub.status.idle":"2024-09-06T18:03:49.862255Z"},"papermill":{"duration":0.013956,"end_time":"2024-09-07T22:36:40.562033","exception":false,"start_time":"2024-09-07T22:36:40.548077","status":"completed"},"tags":[]},"source":["It is important to point out androcentricity or bias in the data which coincidently represent the grounds underlying Bellabeat’s business concept as a women’s health and wellness monitoring platform. Most notably the fact that like Fitbit, measurement and tracking of physiological factors relevant to women are non-existent or are weak at best across the market (Romero-Pareles et al, 2023).\n","The Fitbit data is generic and void of female biometric information for accurate comparisons with Bellabeat. In the case of this study, one size does not fit all (Romero-Pareles et al, 2023). Birth gender assignment information for each user would have been helpful and benefit future editions of this study.\n","Additionally, columns naming activity type and category would clarify how STEP values are to be understood. STEPs are the unit by which the tracking device’s accelerometer detects and measures every and any instance of human movement and is not limited exclusively to walking as has been mistook by other analysts treating this data (Hui et al, 2018).\n","\n","**VII.\tData Processing**\n","•\tDataset was downloaded from Kaggle then imported into Google sheets and each sheet tab was renamed according to the dataset filenames. \n","•\tWhen importing “hourlyCalories_merged.csv” the following error message was thrown: Too large to import. Remove rows or columns and try again. This led me to move further processing of this file and all other files of similar or greater size to SQL or R after initial cleanup.\n","•\tAdded “april_may” to each filename in folder containing data from April through May. I didn't believe to do the same in the folder containing March through April.\n","•\tCreated new dataframes in R “daily_activity” and “sleep_day\n","•\tAdded more dataframes using RStudio to bring datasets down to more workable sizes and calculating numerical averages using ‘group_by’ and ‘mean’ commands.\n","•\tWith “Id” as the primary key used Tableau’s ‘Datasource’ console to establish the following relationships, joins and merges of ten logical tables and a union table  (Figure 1):\n","\n","\n"," \n","Figure 1: Tableau Relationship Tree"]},{"cell_type":"markdown","id":"2a74cf9d","metadata":{"papermill":{"duration":0.013805,"end_time":"2024-09-07T22:36:40.590463","exception":false,"start_time":"2024-09-07T22:36:40.576658","status":"completed"},"tags":[]},"source":["![Figure 1](https://storage.googleapis.com/kagglesdsdata/datasets/5656984/9335500/Bellabeat_2_Screenshot%202024-08-05%20161030.jpg?X-Goog-Algorithm=GOOG4-RSA-SHA256&X-Goog-Credential=databundle-worker-v2%40kaggle-161607.iam.gserviceaccount.com%2F20240906%2Fauto%2Fstorage%2Fgoog4_request&X-Goog-Date=20240906T191046Z&X-Goog-Expires=345600&X-Goog-SignedHeaders=host&X-Goog-)"]},{"cell_type":"markdown","id":"f00bcf31","metadata":{"papermill":{"duration":0.013943,"end_time":"2024-09-07T22:36:40.61833","exception":false,"start_time":"2024-09-07T22:36:40.604387","status":"completed"},"tags":[]},"source":["**Pseudonym Naming Convention \n","**  \n","For ease of use and clarity, aliases were appointed to the 'Id' primary key for each of the 35 user files listed only by an identification number. Since gender assignment from birth was unknown, best efforts to use gender neutral nomenclature had been undertaken (Figure 2).  \n"]},{"cell_type":"markdown","id":"ae3d6ac6","metadata":{"papermill":{"duration":0.013702,"end_time":"2024-09-07T22:36:40.645956","exception":false,"start_time":"2024-09-07T22:36:40.632254","status":"completed"},"tags":[]},"source":["![Figure 2](https://storage.googleapis.com/kagglesdsdata/datasets/5657242/9335877/Alias-Screenshot%202024-09-02%20054356.jpg?X-Goog-Algorithm=GOOG4-RSA-SHA256&X-Goog-Credential=databundle-worker-v2%40kaggle-161607.iam.gserviceaccount.com%2F20240906%2Fauto%2Fstorage%2Fgoog4_request&X-Goog-Date=20240906T210221Z&X-Goog-Expires=345600&X-Goog-SignedHeaders=host&X-Goog-)"]},{"cell_type":"markdown","id":"74c2271e","metadata":{"papermill":{"duration":0.01434,"end_time":"2024-09-07T22:36:40.674598","exception":false,"start_time":"2024-09-07T22:36:40.660258","status":"completed"},"tags":[]},"source":["**VIII.\tData Analysis**\n","\n","Metrics and Measurements\n","A metabolic equivalent (MET) measures the oxygen consumed at rest and is used to express the energy cost of physical activities (Jetté et al., 1990). It helps recommend and prescribe exercise, such as 150 minutes per week of moderate-intensity (3–6 METs) or 75 minutes per week of vigorous-intensity (6–9 METs) exercise to improve health.\n"]},{"cell_type":"markdown","id":"4333c352","metadata":{"papermill":{"duration":0.014408,"end_time":"2024-09-07T22:36:40.703898","exception":false,"start_time":"2024-09-07T22:36:40.68949","status":"completed"},"tags":[]},"source":["![](https://storage.googleapis.com/kagglesdsdata/datasets/5657317/9335974/Table%202%20Mets%20score%20summary.jpg?X-Goog-Algorithm=GOOG4-RSA-SHA256&X-Goog-Credential=databundle-worker-v2%40kaggle-161607.iam.gserviceaccount.com%2F20240906%2Fauto%2Fstorage%2Fgoog4_request&X-Goog-Date=20240906T213436Z&X-Goog-Expires=345600&X-Goog-SignedHeaders=host&X-Goog-)"]},{"cell_type":"markdown","id":"dee9b01b","metadata":{"papermill":{"duration":0.014333,"end_time":"2024-09-07T22:36:40.732472","exception":false,"start_time":"2024-09-07T22:36:40.718139","status":"completed"},"tags":[]},"source":["Another metric known as Cardiorespiratory fitness (CRF) is crucial for preventing diseases like coronary heart disease, stroke, type 2 diabetes, and certain cancers. CRF, measured through exercise tolerance testing, reflects the ability of the circulatory, respiratory, and muscular systems to supply oxygen during sustained activity. An increase in CRF by 1 MET reduces overall mortality by 13% and cardiovascular disease risk by 15%, independent of traditional risk factors (Cristi-Montero, 2016).\n","\n","\n","\n","\n","*Key Findings & Relevant Scientific Data Support*\n","\n","A.\tMaximum Counts of 1440 “SedentaryMinutes” and a minimum value of “0.000” in any other activity field including sleep reflect users having no measure for either. Devices may not have been worn or the user may have deactivated these settings.\n","\n","B.\tThere are 35 unique user IDs in the “daily_activity” table and 24 in “sleep_day”. Eleven participants lack sleep tracking details.\n","\n"]},{"cell_type":"markdown","id":"25dfda05","metadata":{"papermill":{"duration":0.013929,"end_time":"2024-09-07T22:36:40.760327","exception":false,"start_time":"2024-09-07T22:36:40.746398","status":"completed"},"tags":[]},"source":["![](https://storage.googleapis.com/kagglesdsdata/datasets/5657317/9335974/Table%203%20Daily%20Activity%20Summary.jpg?X-Goog-Algorithm=GOOG4-RSA-SHA256&X-Goog-Credential=databundle-worker-v2%40kaggle-161607.iam.gserviceaccount.com%2F20240906%2Fauto%2Fstorage%2Fgoog4_request&X-Goog-Date=20240906T214506Z&X-Goog-Expires=345600&X-Goog-SignedHeaders=host&X-Goog-)\n","\n","![Table 4 Daily Activity Summary](https://storage.googleapis.com/kagglesdsdata/datasets/5657350/9336018/Daily%20Activity%20SummaryScreenshot%202024-08-27%20200517.jpg?X-Goog-Algorithm=GOOG4-RSA-SHA256&X-Goog-Credential=databundle-worker-v2%40kaggle-161607.iam.gserviceaccount.com%2F20240906%2Fauto%2Fstorage%2Fgoog4_request&X-Goog-Date=20240906T214802Z&X-Goog-Expires=345600&X-Goog-SignedHeaders=host&X-Goog-)\n","\n","![](https://storage.googleapis.com/kagglesdsdata/datasets/5657317/9335974/Table%205%20Sleep%20Summary.jpg?X-Goog-Algorithm=GOOG4-RSA-SHA256&X-Goog-Credential=databundle-worker-v2%40kaggle-161607.iam.gserviceaccount.com%2F20240906%2Fauto%2Fstorage%2Fgoog4_request&X-Goog-Date=20240906T215046Z&X-Goog-Expires=345600&X-Goog-SignedHeaders=host&X-Goog-)"]},{"cell_type":"markdown","id":"230985d5","metadata":{"papermill":{"duration":0.014615,"end_time":"2024-09-07T22:36:40.788766","exception":false,"start_time":"2024-09-07T22:36:40.774151","status":"completed"},"tags":[]},"source":["C.\tHow Sleep Quality Improves Physical Training Quality:\n","\n","•\tEnhanced Recovery: Quality sleep allows muscle tissue to recover and repair between workouts, leading to better performance and reduced risk of injury (Johns Hopkins Medicine).\n","\n","•\tIncreased Energy Levels: Adequate sleep provides the energy needed for effective workouts, improving endurance and strength (Johns Hopkins Medicine).\n","\n","•\tImproved Focus and Motivation: Good sleep enhances cognitive function, helping you stay focused and motivated during training sessions (Healthline).\n","\n","•\tHormonal Balance: Sleep regulates hormones like cortisol and growth hormone, which are crucial for muscle growth and recovery (Johns Hopkins Medicine).\n","\n","D.\tHow Physical Training Improves Sleep Quality:\n","\n","•\tFaster Sleep Onset: Regular exercise helps you fall asleep more quickly by reducing the time it takes to fall asleep (Everyday Health).\n","\n","•\tBetter Sleep Quality: Moderate to vigorous exercise increases the amount of deep sleep, which is essential for physical and mental rejuvenation (Everyday Health).\n","\n","•\tReduced Sleep Disorders: Exercise can alleviate symptoms of sleep disorders like insomnia and obstructive sleep apnea (Sleep Foundation).\n","\n","•\tStress Reduction: Physical activity reduces stress levels, promoting relaxation and better sleep (Sleep Foundation).\n"]},{"cell_type":"markdown","id":"3dfdbe3e","metadata":{"papermill":{"duration":0.013923,"end_time":"2024-09-07T22:36:40.816554","exception":false,"start_time":"2024-09-07T22:36:40.802631","status":"completed"},"tags":[]},"source":["![](https://storage.googleapis.com/kagglesdsdata/datasets/5657317/9335974/Table%206%20Intensity.jpg?X-Goog-Algorithm=GOOG4-RSA-SHA256&X-Goog-Credential=databundle-worker-v2%40kaggle-161607.iam.gserviceaccount.com%2F20240906%2Fauto%2Fstorage%2Fgoog4_request&X-Goog-Date=20240906T215843Z&X-Goog-Expires=345600&X-Goog-SignedHeaders=host&X-Goog-)"]},{"cell_type":"markdown","id":"e30af9bc","metadata":{"papermill":{"duration":0.014115,"end_time":"2024-09-07T22:36:40.847398","exception":false,"start_time":"2024-09-07T22:36:40.833283","status":"completed"},"tags":[]},"source":["Resting heart rate (RHR) is the number of times your heart beats per minute while you're not active. It's also known as your pulse. A normal RHR for a healthy adult is between 60 and 100 beats per minute, with most people having a rate below 90, yet children's heart rates are usually faster than adults.\n","\n","At worst, low cardiorespiratory fitness (CRF) and elevated resting heart rate (RHR) are associated with an increased risk of cardiovascular disease (CVD) and overall mortality (Saxena, 2013).\n","\n","At best, a well-trained athlete could have a resting heart rate closer to 40 bpm and professional endurance athletes into the mid-30s (Bumgardner, 2024). However, there is evidence and cause for caution that RHR < 60 could be linked to medication, heart ailments or other factors (American Heart Association, 2024)\n"]},{"cell_type":"markdown","id":"f38a0830","metadata":{"papermill":{"duration":0.016362,"end_time":"2024-09-07T22:36:40.879004","exception":false,"start_time":"2024-09-07T22:36:40.862642","status":"completed"},"tags":[]},"source":["![](https://storage.googleapis.com/kagglesdsdata/datasets/5657317/9335974/Table%207%20HR.jpg?X-Goog-Algorithm=GOOG4-RSA-SHA256&X-Goog-Credential=databundle-worker-v2%40kaggle-161607.iam.gserviceaccount.com%2F20240906%2Fauto%2Fstorage%2Fgoog4_request&X-Goog-Date=20240906T220348Z&X-Goog-Expires=345600&X-Goog-SignedHeaders=host&X-Goog-)"]},{"cell_type":"markdown","id":"e1837469","metadata":{"papermill":{"duration":0.014842,"end_time":"2024-09-07T22:36:40.908612","exception":false,"start_time":"2024-09-07T22:36:40.89377","status":"completed"},"tags":[]},"source":["**IX.\tKey Relationships Detected**\n","Sleep quality can be improved by more physical activity. Sedentary minutes decrease as physical activity increases according to the scatter plot graph (Figure 2) as a result of running the following Rscript:\n","\n","**ggplot(data=daily_activity, aes(x=TotalSteps, y=SedentaryMinutes)) + geom_point()**\n","\n"," It could be argued that Sleep quality is better because of physical activity. Unexpected patterns were evident at both extremes from completely sedentary to high-performing competitors. This was determined based on individual METs score, overall intensity score, volume level and quality of activity time spent. Which means the amount of time spent in very active, fairly active or light activity.\n","\n"]},{"cell_type":"markdown","id":"468c8708","metadata":{"papermill":{"duration":0.014559,"end_time":"2024-09-07T22:36:40.93899","exception":false,"start_time":"2024-09-07T22:36:40.924431","status":"completed"},"tags":[]},"source":["![](https://storage.googleapis.com/kagglesdsdata/datasets/5657380/9336085/Figure%202%20Sedentary%20Minutes.jpg?X-Goog-Algorithm=GOOG4-RSA-SHA256&X-Goog-Credential=databundle-worker-v2%40kaggle-161607.iam.gserviceaccount.com%2F20240906%2Fauto%2Fstorage%2Fgoog4_request&X-Goog-Date=20240906T221506Z&X-Goog-Expires=345600&X-Goog-SignedHeaders=host&X-Goog-)"]},{"cell_type":"markdown","id":"d7139c55","metadata":{"papermill":{"duration":0.013988,"end_time":"2024-09-07T22:36:40.967639","exception":false,"start_time":"2024-09-07T22:36:40.953651","status":"completed"},"tags":[]},"source":["More time in bed translates into longer sleep according to the plot from the following Rscript:\n","\n","**ggplot(data=sleep_day, aes(x=TotalMinutesAsleep, y=TotalTimeInBed)) + geom_point()**\n"]},{"cell_type":"markdown","id":"ae5e5a1c","metadata":{"papermill":{"duration":0.013866,"end_time":"2024-09-07T22:36:40.995679","exception":false,"start_time":"2024-09-07T22:36:40.981813","status":"completed"},"tags":[]},"source":["![](https://storage.googleapis.com/kagglesdsdata/datasets/5657380/9336085/Figure%204%20Time%20in%20Bed%20Vs%20Sleep.jpg?X-Goog-Algorithm=GOOG4-RSA-SHA256&X-Goog-Credential=databundle-worker-v2%40kaggle-161607.iam.gserviceaccount.com%2F20240906%2Fauto%2Fstorage%2Fgoog4_request&X-Goog-Date=20240906T221830Z&X-Goog-Expires=345600&X-Goog-SignedHeaders=host&X-Goog-)"]},{"cell_type":"markdown","id":"6c504e74","metadata":{"papermill":{"duration":0.014235,"end_time":"2024-09-07T22:36:41.029562","exception":false,"start_time":"2024-09-07T22:36:41.015327","status":"completed"},"tags":[]},"source":[]},{"cell_type":"markdown","id":"c6e3adb0","metadata":{"papermill":{"duration":0.015003,"end_time":"2024-09-07T22:36:41.05843","exception":false,"start_time":"2024-09-07T22:36:41.043427","status":"completed"},"tags":[]},"source":["**X.\tRecommendations:**\n","Upon review of the available data it may benefit the company to consider the recommended actions to follow:\n","•\tStep up advertising, marketing and promotions to attract new customers\n","•\tSwitch active women from other platforms to Bellabeat.\n","•\tInfluence existing Bellabeat customers to form new habits including tracking all measurables for a more complete data profile, better health outcomes in a more physically active lifestyle?\n","•\tMarketing and selling full featured immersive Bellabeat+ Club Membership experiences may boost revenue growth.\n","•\tMarketing lifestyle accessories such as bedtime comfort apparel and sleep regimen products fit nicely alongside Bellabeat’s existing assortment of wellness lifestyle products.\n","\n","\n","**XI.\tConclusion**\n","Although Bellabeat must continue to support the needs and adapt along with its established endurance training community, there may be commercial opportunity in promoting Concurrent Training alternatives to this audience, as well as providing options to those who are trying figure out optimal training modalities that suit them best(Hughes, 2018). Contrary to the archaic “No pain, no gain” dogma that still resonates across the fitness landscape, the latest research is not broadly understood by the average consumer that significant gains can be achieved with less training density and while offsetting symptoms of overtraining syndrome (OTS) which can be deduced from the scatterplots to some extent (“Overtraining Syndrome”, 2024). \n","Bellabeat new product development should embark on upgrading existing recovery, restoration and mindfulness mobile components to include a toolkit to trace symptoms and prevent OTS especially for elite competitive athletes such as Olympic gold medalist and Bellabeat sponsored athlete Masai Russell (Kreher, 2016).\n","The misconception that less is weak and more is strong is wrong. These misconceptions and guru misguidance create emotional as well as physical obstacles towards maintaining consistent health and fitness habits (“Hidden Dangers”, 2024). \n","Research suggests that any physical activity can improve CRF. According to Powell, “Some activity is better than none, and more is better than some” (Powell et al, 2011). Even light-intensity activity is beneficial and preferable to inactivity, especially for those unable to perform high-intensity exercise. Both volume and intensity of activity are important for reducing cardiovascular disease risk and enhancing CRF, with intensity having a stronger influence on the adaptive response to exercise training (Hughes et al, 2018). Sprint Interval Training (SIT) and High Interval Intensity Training (HIIT) are very effective ways to increase METs score and CRF with less wear and tear (Hughes et al, 2018)\n","\n","We have established that elevating METs and CRF scores are the fundamental goal and measure from this data analysis. The usefulness of this information for our stakeholders revolves around key issues which are quality of life over time, disease prevention and life expectancy.  The user must now ask, “are my numbers showing a positive or dangerous pattern… is what I’m doing inhibiting or extending my life expectancy. Can I handle the lifestyle to straighten this out? “If so, how?” now becomes Bellabeat’s burden to prove co-journeying alongside the consumers as a resource and supplier of goods, services and cutting edge research towards a longer, better life.\n","\n","\n","\n","**XII.\tReferences**\n","\n","Bibliography\n","\n","Future Market Insights. (2023). Wearable Fitness Technology Market - \n","Future Market Insights. Retrieved from Future Market Insights\n","\n","Statista. (2023). Use of fitness wearables in the U.S, 2023, by gender. Retrieved from Statista\n","\n","Wareable. (2024).Best fitness trackers for 2024: Our experts’ recommendations. Retrieved from Wareable\n","\n","Wirecandy. (n.d.). Fitbit Vs Bellabeat: A Detailed Comparison of Two Leading Fitness Brands. Retrieved from Wirecandy\n","\n","Beepinghand. (n.d.). Bellabeat Vs Fitbit: Which one is Best? Retrieved from Beepinghand\n","\n","About Us. (2024). Retrieved from https://bellabeat.com/about-us/\n","Hui, J., Heyden, R., Bao, T., Accettone, N., McBay, C., Richardson, \n","\n","J., & Tang, A. (2018). Validity of the Fitbit One for Measuring Activity in Community-Dwelling Stroke Survivors. Physiotherapy Canada. Physiotherapie Canada, 70(1), 81–89. https://doi.org/10.3138/ptc.2016-40.ep\n","\n","Google Data Analytics Capstone Project casestudy 2. (n.d.). Retrieved from https://www.kaggle.com/code/quy5002/google-data-analytics-capstone-project-casestudy-2/notebook\n","\n","Cristi-Montero C. (2016). Considerations regarding the use of metabolic equivalents when prescribing exercise for health: preventive medicine in practice. The Physician and sportsmedicine, 44(2), 109–111. https://doi.org/10.1080/00913847.2016.1158624\n","\n","Powell, K. E., Paluch, A. E., & Blair, S. N. (2011). Physical activity for health: What kind? How much? How intense? On top of what?. Annual review of public health, 32, 349–365. https://doi.org/10.1146/annurev-publhealth-031210-101151R \n","\n","Core Team (2024). _R: A Language and Environment for  Statistical Computing_. R Foundation for Statistical Computing, Vienna, Austria. <https://www.R-project.org/>.\n","\n","Romero-Perales, E., Sainz-de-Baranda Andujar, C., & López-Ongil, C. (2023). Electronic Design for Wearables Devices Addressed from a Gender Perspective: Cross-Influences and a Methodological Proposal. Sensors (Basel, Switzerland), 23(12), 5483. https://doi.org/10.3390/s23125483\n","\n","Jetté, M., Sidney, K., & Blümchen, G. (1990). Metabolic equivalents (METS) in exercise testing, exercise prescription, and evaluation of functional capacity. Clinical cardiology, 13(8), 555–565. https://doi.org/10.1002/clc.4960130809\n","\n","Saxena, A., Minton, D., Lee, D. C., Sui, X., Fayad, R., Lavie, C. J., & Blair, S. N. (2013). Protective role of resting heart rate on all-cause and cardiovascular disease mortality. Mayo Clinic proceedings, 88(12), 1420–1426. https://doi.org/10.1016/j.mayocp.2013.09.011\n","\n","American Heart Association. All About Heart Rate. (2024). Retrieved from https://www.heart.org/en/health-topics/high-blood-pressure/the-facts-about-high-blood-pressure/all-about-heart-rate-pulse\n","\n","Schneider, C., Hanakam, F., Wiewelhove, T., Döweling, A., Kellmann, M., Meyer, T., Pfe